import React from 'react';

const ProfileInfo = ({ name, photoUrl }) => {
  return (
    <div>
      <h2>Name: {name}</h2>
      {photoUrl && <img src={photoUrl} alt="Profile" />}
      {/* Add any other profile-related information here */}
    </div>
  );
};

export default ProfileInfo;
